        "summary": "Create Inbound Shipment",
        "description": "Once youve converted items to WFS, you are ready to start shipping items inbound to Walmart. To do this, you will submit an Inbound shipment request. The Inbound shipment details when you expect to ship product, as well as the items and quantities which will be shipped.\n\nEach shipment you send in to WFS should have a corresponding Inbound shipment. In this case, a shipment would be considered a direct truckload, LTL shipment, or set of items shipped via parcel on a given day.",
        "externalDocs": {
          "description": "View Guide",
          "url": "/doc/us/mp/us-mp-fulfillment/#2901"
        },
        "operationId": "createShipment",
        "parameters": [
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "requestBody": {
          "description": "Request fields",
          "content": {
            "application/json": {
              "schema": {
                "required": [
                  "inboundOrderId",
                  "returnAddress"
                ],
                "type": "object",
                "properties": {
                  "inboundOrderId": {
                    "maxLength": 100,
                    "minLength": 0,
                    "type": "string",
                    "description": "Unique ID identifying inbound shipment request"
                  },
                  "returnAddress": {
                    "required": [
                      "addressLine1",
                      "city",
                      "countryCode",
                      "postalCode",
                      "stateCode"
                    ],
                    "type": "object",
                    "properties": {
                      "addressLine1": {
                        "type": "string",
                        "description": "Address details"
                      },
                      "addressLine2": {
                        "type": "string",
                        "description": "Address details continuation"
                      },
                      "city": {
                        "type": "string",
                        "description": "City name"
                      },
                      "stateCode": {
                        "type": "string",
                        "description": "State Code"
                      },
                      "countryCode": {
                        "type": "string",
                        "description": "Country code"
                      },
                      "postalCode": {
                        "type": "string",
                        "description": "Zip code"
                      }
                    },
                    "description": "Seller return address"
                  },
                  "orderItems": {
                    "maxItems": 5000,
                    "minItems": 1,
                    "type": "array",
                    "description": "inbound shipment request line items",
                    "xml": {
                      "wrapped": true
                    },
                    "items": {
                      "required": [
                        "expectedDeliveryDate",
                        "innerPackQty",
                        "itemDesc",
                        "itemQty",
                        "productId",
                        "productType",
                        "sku",
                        "vendorPackQty"
